import "./index.css";
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
// import { useNavigate } from "react-router-dom";

export const Header= () => {
//   let navigate=useNavigate();
//   const logout = () => {
//     localStorage.removeItem('email');
//     localStorage.removeItem('password');
//     navigate('/')
//     }  
    return (
      <Navbar expand="lg" className="bg-body-tertiary fixed-top" bg="primary" data-bs-theme="dark">
      <Container className="header" fluid>
        <Navbar.Brand href="" className="heading">Library</Navbar.Brand>
        <div>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
            <Nav.Link href="/home" className="nav-point">Home</Nav.Link>
            <Nav.Link href="/about" className="nav-point">About</Nav.Link>
            <Nav.Link href="/contact" className="nav-point">Contact</Nav.Link>
            <Button  className="logout-button">Log out</Button>  
            <li class="nav-item dropdown">
            <a class="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                Dropdown
            </a>
            <ul class="dropdown-menu">
                <li><a class="dropdown-item" href="#">Action</a></li>
                <li><a class="dropdown-item" href="#">Another action</a></li>
                <li>hkg<hr class="dropdown-divider"/>kgjk</li>
                <li><a class="dropdown-item" href="#">Something else here</a></li>
            </ul>
            </li>
          </Nav>
        </Navbar.Collapse>
        </div> 
      </Container>
    </Navbar>
    );
}
